import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  Stack,
  TextField,
  TextStyle,
  EmptyState
} from '@shopify/polaris';
import '@shopify/polaris/styles.css';

const Index = () => (
  
  <Page>

    <Layout>
      
    <EmptyState
        action={{
          content: 'Select products',
          onAction: () => console.log('clicked'),
        }}
        
      >
      </EmptyState>
    </Layout>
  </Page>
);

export default Index;
